import { createBrowserRouter } from "react-router";
import { Amenities } from "./components/Amenities.js"
import { Root } from "./components/Root.js"

let router = createBrowserRouter([{
  path: "/",
  Component: Root,
  children: [{
    path: "Amenities",
    conmponent: Amenities
  }]
}])

exports = {
  router
}
